import React from "react";
import css from "./Uncos.module.css";

const Uncos = (props) => {
  let postsElement = props.posts.map((message) => (
    <UncosElement
      title={message.title}
      img={message.img}
      event={message.event}
    />
  ));
  return <div className={css.posts}>{postsElement} </div>;
};

export default Uncos;
